                sentence += f", with {predicate} being {object_val} "
                if predicate in ("country", "language", "leader"):
                    sentence = sentence.replace(f", with {predicate} being {object_val} ", f" where the {predicate} is {object_val} ")

    return sentence.strip() + "."

